class Menu extends Component
{
    render(){
        return(
            <div>
                <Link to='/'>Menu</Link>{' '} 
                <Link to='/component1'>component1</Link>{' '} 
                <Link to='/component2'>component2</Link>                
            </div> 
        
)
}}
export default Menu
